import React from 'react';
function Hero() {
    return ( 
        <div className='container'>
        <h3 className='mb-2 mt-5 text-center'>Charges</h3>
        <p className='text-muted text-center'>List of all charges and taxes</p>


        <div className='row'>
            <div className="col-4">
          <a
            href="https://www.streak.tech/home"
            alt=""
            style={{ textDecoration: "none" }}
          >
            <img src="media/streakLogo.png" style={{ width: "50%" }} alt="" />
            <p className="text-muted mt-2">Thenatic investment platform</p>
          </a>
        </div>
        </div>


        </div>
        
    );
}

export default Hero;
